@JaredPike.Art is an artist who creates 3D renders of aesthetic pools which include white tiles, and water in pool rooms.

Going beyond just pool basins, Pike also floods hallways and building levels with water, and the fantastical layouts and proportions of these architectural locations help heighten the tension and mystery in each artwork.

Pike uses Blender for 3D modelling, Luxcore for rendering and Lightroom for post-processing to bring the surreal pools to life. #architectanddesign
